BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "utente" (
	"id_utente"	INTEGER NOT NULL,
	"first_name"	VARCHAR(50) NOT NULL,
	"last_name"	VARCHAR(50) NOT NULL,
	"phone_number"	VARCHAR(20) NOT NULL,
	"email"	VARCHAR(100) NOT NULL,
	"password"	VARCHAR(255) NOT NULL,
	"city"	VARCHAR(50) NOT NULL,
	"address"	VARCHAR(100) NOT NULL,
	"cap"	VARCHAR(10) NOT NULL,
	"id_azienda"	INTEGER NOT NULL,
	"id_ruolo"	INTEGER NOT NULL,
	"provincia"	VARCHAR,
	PRIMARY KEY("id_utente"),
	UNIQUE("email"),
	FOREIGN KEY("id_azienda") REFERENCES "azienda"("id_azienda"),
	FOREIGN KEY("id_ruolo") REFERENCES "ruolo"("id_ruolo")
);
CREATE TABLE IF NOT EXISTS "um" (
	"id"	INTEGER NOT NULL,
	"description"	VARCHAR,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "banche" (
	"id"	INTEGER,
	"description"	VARCHAR,
	"iban"	VARCHAR,
	"abi"	VARCHAR,
	"cab"	VARCHAR,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "clienti" (
	"id"	INTEGER,
	"denominazione"	TEXT,
	"nome"	TEXT,
	"cognome"	TEXT,
	"partitaiva"	TEXT,
	"codicefiscale"	TEXT,
	"indirizzo"	TEXT,
	"civico"	TEXT,
	"cap"	TEXT,
	"comune"	TEXT,
	"provincia"	TEXT,
	"nazione"	TEXT,
	"SDI"	TEXT,
	"giuridica"	BOOLEAN DEFAULT 0,
	"email"	TEXT,
	"pec"	TEXT,
	"telefono"	TEXT,
	"cellulare"	TEXT,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "codiva" (
	"id"	INTEGER NOT NULL,
	"description"	VARCHAR,
	"aliquota"	FLOAT,
	"natura"	VARCHAR,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "fornitori" (
	"id"	INTEGER,
	"denominazione"	TEXT,
	"nome"	TEXT,
	"cognome"	TEXT,
	"partitaiva"	TEXT,
	"codicefiscale"	TEXT,
	"indirizzo"	TEXT,
	"civico"	TEXT,
	"cap"	TEXT,
	"comune"	TEXT,
	"provincia"	TEXT,
	"nazione"	TEXT,
	"SDI"	TEXT,
	"giuridica"	BOOLEAN DEFAULT 0,
	"email"	TEXT,
	"pec"	TEXT,
	"telefono"	TEXT,
	"cellulare"	TEXT,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "movmag" (
	"id"	INTEGER,
	"articolo_id"	VARCHAR,
	"quantita"	INT,
	"um"	INT,
	"prezzo"	FLOAT,
	"iva"	INT,
	"descrizione"	VARCHAR,
	"testata_id"	INT,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("articolo_id") REFERENCES "articoli"("id"),
	FOREIGN KEY("um") REFERENCES "um"("id"),
	FOREIGN KEY("testata_id") REFERENCES "testmag"("id"),
	FOREIGN KEY("iva") REFERENCES "codiva"("id")
);
CREATE TABLE IF NOT EXISTS "numerazioni" (
	"id"	INTEGER,
	"id_sezionale"	INTEGER,
	"numero"	INTEGER,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "products" (
	"id"	INTEGER NOT NULL,
	"description"	VARCHAR,
	"category"	INTEGER,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "reparti" (
	"id"	INTEGER NOT NULL,
	"description"	VARCHAR,
	"printer"	VARCHAR,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "ruolo" (
	"id_ruolo"	INTEGER NOT NULL,
	"nome_ruolo"	VARCHAR(50) NOT NULL,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id_ruolo")
);
CREATE TABLE IF NOT EXISTS "sezionali" (
	"id"	INTEGER,
	"descrizione"	VARCHAR,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "shops" (
	"id"	INTEGER NOT NULL,
	"descrizione"	VARCHAR,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "tables" (
	"id"	INTEGER NOT NULL,
	"shop"	INTEGER,
	"number"	INTEGER,
	"status"	INTEGER,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id"),
	FOREIGN KEY("shop") REFERENCES "shops"("id")
);
CREATE TABLE IF NOT EXISTS "testmag" (
	"id"	INTEGER,
	"fornitore_id"	INT,
	"numero_doc"	VARCHAR,
	"sezionale"	VARCHAR,
	"date"	VARCHAR,
	"totale"	FLOAT,
	"iva"	FLOAT,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("fornitore_id") REFERENCES "fornitori"("id")
);
CREATE TABLE IF NOT EXISTS "checks" (
	"uuid"	VARCHAR NOT NULL,
	"checktype"	INTEGER NOT NULL,
	"checktime"	DATETIME NOT NULL,
	"device_serial_number"	VARCHAR NOT NULL,
	"device_name"	VARCHAR NOT NULL,
	"employee_first_name"	VARCHAR NOT NULL,
	"employee_last_name"	VARCHAR NOT NULL,
	"employee_workno"	VARCHAR NOT NULL,
	"employee_department"	VARCHAR NOT NULL,
	"employee_job_title"	VARCHAR,
	"id_azienda"	INTEGER,
	PRIMARY KEY("uuid")
);
CREATE TABLE IF NOT EXISTS "azienda" (
	"id_azienda"	INTEGER NOT NULL,
	"nome_azienda"	VARCHAR(100) NOT NULL,
	"forma_giuridica"	VARCHAR(50) NOT NULL,
	"codice_fiscale"	VARCHAR(16) NOT NULL,
	"partita_iva"	VARCHAR(11) NOT NULL,
	"sede_legale"	VARCHAR(255) NOT NULL,
	"comune"	VARCHAR,
	"cap"	VARCHAR,
	"provincia"	VARCHAR(2),
	"phone"	VARCHAR,
	"mail"	VARCHAR,
	"api_key_doceasy"	VARCHAR,
	"api_secret_doceasy"	VARCHAR,
	"nome"	VARCHAR,
	"cognome"	VARCHAR,
	"rfiscale"	VARCHAR,
	"civico"	VARCHAR,
	"utenza_sidae"	VARCHAR,
	"sidae"	INTEGER DEFAULT 0,
	"ae_user"	VARCHAR,
	"ae_password"	VARCHAR,
	"ae_pin"	VARCHAR,
	UNIQUE("codice_fiscale"),
	PRIMARY KEY("id_azienda"),
	UNIQUE("partita_iva")
);
CREATE TABLE IF NOT EXISTS "pagamenti" (
	"id"	INTEGER,
	"description"	VARCHAR,
	"tipo"	VARCHAR,
	"rate"	INTEGER,
	"banca"	INTEGER,
	"id_azienda"	INTEGER,
	"condizioni"	VARCHAR,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "comande" (
	"id"	INTEGER NOT NULL,
	"table"	INTEGER,
	"note"	VARCHAR,
	"contenuto"	JSON,
	"cliente"	INTEGER,
	"status"	INTEGER,
	"date"	DATETIME NOT NULL,
	"id_azienda"	INTEGER,
	"idScontrino"	VARCHAR,
	"numeroDoc"	VARCHAR,
	"annullato"	INTEGER DEFAULT 0,
	"iva"	FLOAT,
	"totale"	FLOAT,
	"pagamento"	VARCHAR,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "fatture" (
	"id"	INTEGER NOT NULL,
	"id_azienda"	INTEGER,
	"inviato"	INTEGER DEFAULT 0,
	"Doceasy"	VARCHAR NOT NULL,
	"cliente"	INTEGER,
	"fileId"	VARCHAR,
	"corpo"	JSON,
	"pagamento"	JSON,
	"sezionale"	JSON,
	"numero"	INTEGER,
	"date"	VARCHAR,
	"totale"	FLOAT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "ingredienti" (
	"id"	INTEGER NOT NULL,
	"description"	VARCHAR,
	"id_azienda"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "giacenze" (
	"id"	INTEGER NOT NULL,
	"id_azienda"	INTEGER,
	"id_articolo"	INTEGER,
	"giacenza"	FLOAT,
	PRIMARY KEY("id"),
	FOREIGN KEY("id_articolo") REFERENCES "articoli"("id")
);
CREATE TABLE IF NOT EXISTS "categories" (
	"id"	INTEGER NOT NULL,
	"description"	VARCHAR,
	"reparto"	INTEGER,
	"id_azienda"	INTEGER,
	"descrizione_agg"	VARCHAR,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "articoli" (
	"id"	INTEGER NOT NULL,
	"code"	VARCHAR(255),
	"description"	VARCHAR(255),
	"um"	VARCHAR(255),
	"iva"	INTEGER,
	"img"	VARCHAR(255),
	"category_id"	INTEGER,
	"prezzo"	FLOAT,
	"id_azienda"	INTEGER,
	"ingredienti"	JSON,
	"vegetariano"	INTEGER DEFAULT 0,
	"vegano"	INTEGER DEFAULT 0,
	"celiaco"	INTEGER DEFAULT 0,
	"menu"	INTEGER DEFAULT 0,
	"varianti"	INTEGER DEFAULT 0,
	"varianti_list"	JSON,
	PRIMARY KEY("id"),
	FOREIGN KEY("um") REFERENCES "um"("id"),
	FOREIGN KEY("iva") REFERENCES "codiva"("id"),
	FOREIGN KEY("category_id") REFERENCES "categories"("id")
);
CREATE TABLE IF NOT EXISTS "varianti" (
	"id"	INTEGER NOT NULL,
	"code"	VARCHAR(255),
	"description"	VARCHAR(255),
	"id_azienda"	INTEGER,
	"ingredienti"	JSON,
	PRIMARY KEY("id")
);
COMMIT;
